           <button onClick={() => {}} className=" hover:bg-[#009686] bg-black w-[150px] rounded-md  font-semibold my-4 mx-auto md:mx-0 py-2 text-white">Get Started</button>
          </div>
        </div>
      
    </div>
  );
}

export default Analytics;
